let ShowGridLinesInstance = null;
module.exports = class yAxis {

    constructor() {
        if (!ShowGridLinesInstance) {
            ShowGridLinesInstance = this;
            //set all other default values

            this.displayAs = 'Show Grid Lines';
            this.value = '[showGridLines]'
            this.type = 'TOGGLE';
            this.values = {'true-value':'true', 'false-value': 'false'}
        }
        return ShowGridLinesInstance;
    }
}